import React from "react";
import "./intro.scss";
import profile from "../../img/profile.img";

function Intro() {
  return (
    <div className="intro" id="intro">
      <div className="left">
        <div className="imgContainer">
          <img src={profile} alt="" />
        </div>
      </div>
      <div className="right">right</div>
    </div>
  );
}

export default Intro;
